function Default_Load() {
    //loginTextbox();
    var $ = jQuery;
	
	var firstV = readCookie("firstVisit");
    var NavLang = navigator.language;
    if (NavLang == null) {
        NavLang = navigator.userLanguage;
    }
        //alert(firstV + "; plang " + NavLang);       
    if (firstV == "Y") {
        if (NavLang == "ja" || NavLang == "ja-JP") {
            __doPostBack('LinkButton_JP', '');
        }
        else if (NavLang == "zh-TW") {
            __doPostBack('LinkButton_cht', '');
        }
        else if (NavLang == "en-US") {
             __doPostBack('LinkButton_en', '');
        }
    }
	//lang end
	
    var myVar = setInterval(function () { fitsize(); }, 200);
    setTimeout(function () { clearInterval(myVar); }, 7000)

    //choose-weintek
    maxNum = 8;
    minNum = 0;
    Namsec = 4000
    Minsec = 1200
    setInterval(function () { flipboxY(); }, 3000);
    setInterval(function () { TestboxX(); }, 4000);
    //choose-weintek

    jQuery(".login").fancybox({
        parent: "form:first",
        maxWidth: 350,
        maxHeight: 410,
        fitToView: true,
        'frameWidth': 350,
        'frameHeight': 410,
        width: '95%',
        height: '410px',
        autoSize: false,
        closeClick: false,
        openEffect: 'elastic',
        closeEffect: 'elastic',
        openMethod: 'changeIn',
        scrolling: 'no',
        overflow: 'hidden',
        'modal': true,
        padding: 0,
        helpers: {
            overlay: {
                locked: false
            }
        }
    });

    jQuery("#srLInk").click(function () {
        if (jQuery(".LoginID").html() == "") {
            jQuery("#TB_LOGN_MSG").css('display', '');
            jQuery(".LBL_RS").val("RS");
        }
        else {
            document.location.href = "Support/SR_NewIssue.aspx";
        }
    })


    var userAgent = navigator.userAgent.toLowerCase();
    if (/ipad/i.test(userAgent)) {

        jQuery("#product_drop").click(function () {
            if (jQuery("#Series_menu").css('display') == "none") {
                jQuery("#Series_menu").show();
            }
            else {
                jQuery("#Series_menu").hide();
            }
        })
        jQuery(".navbar-default .navbar-nav > li > a.active").css({ "color": "#FFFFFF", 'background-color': '#404b59' });
        jQuery(".navbar-default .navbar-nav > li").click(function () {
            jQuery(".navbar-default .navbar-nav > li > a").css({ "color": "#333333", 'background-color': 'transparent' });
            jQuery(this).find("a").css({ "color": "#FFFFFF", 'background-color': '#404b59' });
            jQuery(this).find(".drop-down").css({ 'visibility': 'visible', 'opacity': '1' });
            if (jQuery(this).find(".drop-down").prop('id') != "series_drop-down") {
                jQuery("#Series_menu").hide();
            }
        })

        jQuery(".testimonials-box").html('<img src="images/why-chooes-weintek.png"/ width="100%">');
        jQuery("#flash").hide();
    }
    else {
        /*主視覺下移*/
        jQuery(".drop").hover(function () {
            if (jQuery(this).hasClass("drop_none") == false) {
                var btn_h = jQuery(".subnav").height();
                //                        var btn_h = jQuery(this).children('.drop-down').children('.subnav').height();
                if (jQuery(this).attr('id') == "product_drop") {

                    btn_h = jQuery("#series_btn_inner").height();
                }

                jQuery("#slider").css({ "margin-top": btn_h - 14 + 'px' });
            }
        }, function () {
            jQuery("#slider").css("margin-top", '0px');
        })

        jQuery("#flash_pic").hide();
    }




    jQuery(window).scroll(function () {
        var scrollset = jQuery(window).scrollTop() + jQuery(window).height() - 50;
        var colset = jQuery('.col-md-4:eq(0)').offset().top;
        var Tsetion_T = jQuery('.title-section p').offset().top;
        var News_T=0;
		if (jQuery('.news-item').length > 0){
			News_T = jQuery('.news-item:eq(0)').offset().top;
		}else{
			News_T = jQuery('.services-box').offset().top;
		}
        var testimonials_H = jQuery(".testimonials-box").offset().top;
        if (scrollset > colset) {
            jQuery(".col-md-4:eq(0)").animate({ 'left': '0px' }, 600, "easeOutCubic");
            setTimeout(function () {
                jQuery(".col-md-4:eq(1)").animate({ 'left': '0px' }, 600, "easeOutCubic");
            }, 300)
            setTimeout(function () {
                jQuery(".col-md-4:eq(2)").animate({ 'left': '0px' }, 600, "easeOutCubic");
            }, 500)
        }
        if (scrollset > Tsetion_T) {
            setTimeout(function () {
                jQuery(".title-section h1").animate({ 'top': '0px' }, 200, "easeOutCubic");
            }, 200)
            setTimeout(function () {
                jQuery(".title-section p").animate({ 'top': '0px' }, 200, "easeOutCubic");
            }, 400)
        }
        if (scrollset > News_T) {
            setTimeout(function () {
                jQuery(".news-item:eq(0)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 200)
            setTimeout(function () {
                jQuery(".news-item:eq(1)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 500)
            setTimeout(function () {
                jQuery(".news-item:eq(2)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 700)
            setTimeout(function () {
                jQuery(".news-item:eq(3)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 900)
            setTimeout(function () {
                jQuery(".news-item:eq(4)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 1000)
            setTimeout(function () {
                jQuery(".news-item:eq(5)").animate({ 'left': '0px' }, 800, "easeOutCubic");
            }, 1100)
        }
    })
}
