window.addEventListener("resize", function () {
    sociallink_top()
});

function sociallink_top() {
    var ullink=document.querySelector("#ul_sociallink"),
        ww = window.innerWidth || document.documentElement.clientWidth
		|| document.body.clientWidth;
    if (ullink) {
        if (ww < 1200) {
            AddSingleClass(ullink, "s_980less");
            removeCls(ullink, "s_980more");
        }
        if (ww > 1200) {
            removeCls(ullink, "s_980less");
            AddSingleClass(ullink, "s_980more");
        }
    }
}
function AddSingleClass(el,Cname){
    if (el) {
        if ((el.className).indexOf(Cname)==-1){
            el.className += ' ' + Cname;
        }
    }
}
function removeCls(el, className) {
    if (el) {
        if (el.classList) {
            el.classList.remove(className);
        }
        else {
            el.className = el.className.replace(new RegExp('(^|\\b)' + className.split(' ').join('|') + '(\\b|$)', 'gi'), ' ');
        }
    }
}

